import Review from "../components/Review";

const Home = () => {
  return (
    <section className="bg-[#9FB1BCFF] w-full h-full flex-col overflow-hidden ">
      <header className=" h-screen bg-no-repeat bg-cover bg-fixed bg-[url('https://i.gifer.com/slo.gif')]">
        <article className="text-center top-96 relative capitalize text-yellow-50 text-3xl font-sans">
          <h5>Hi my name is</h5>
          <h1>Nicholas Stevens</h1>
          <h2>I'm a Full Stack Developer.</h2>
          <p>I'm a Full Stack Devoloper specializing in the frontend.</p>
        </article>
      </header>
      <div className=" h-full">
        <div className="h-full p-12">
          <h2>Some reviews</h2>
          <Review />
        </div>
      </div>
    </section>
  );
};

export default Home;
